import React from "react";
import styled from "styled-components";

const Contacts = () => {

    return (
        <ContactsContainer>
            <h1>Contacts</h1>
            <Img></Img>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 80%;
    height: 100vh;
    margin: 0px auto;
    text-align: center
`

const Img = styled.div`
    width: 437px;
    height: 882px;
    background-image: url(public/iPhoneImage/iPhoneImage.svg);
`  

export default Contacts
